class App extends React.Component {
  state = {
    value1: 210,
    value2: 45
  };

  changeValue(){
    this.setState({value1: this.state.value1 + 10});
  }

  render(){
    return (
      <div  onClick={this.changeValue.bind(this)}>
        <ReactMeter 
          title="chiffre d'affaire Q1 2016"
          subtitle="sans les gratuits"
          value={this.state.value1} 
          minValue={200} 
          maxValue={500} 
          unit="k€"/>
        <ReactMeter 
          title="objectifs de CA"
          subtitle="par rapport à l'annee dernière"
          value={this.state.value2} 
          minValue={0} 
          maxValue={100} 
          unit="%"/>
        <ReactMeter 
          title="objectifs de CA"
          subtitle="par rapport à l'annee dernière"
          value={Math.floor(Math.random()*100)} 
          minValue={0} 
          maxValue={100} 
          unit="%"/>
        <ReactMeter 
          title="objectifs de CA"
          subtitle="par rapport à l'annee dernière"
          value={Math.floor(Math.random()*100)} 
          minValue={0} 
          maxValue={100} 
          unit="%"/>
      </div>
    );
  }
}

ReactDOM.render(<App/>, document.getElementById("app"));
